import { Container, Row, Col } from "react-bootstrap";
import Carousel from "react-multi-carousel";
import "react-multi-carousel/lib/styles.css";
import meter1 from "../assets/img/meter1.svg";
import meter2 from "../assets/img/meter2.svg";
import meter3 from "../assets/img/meter3.svg";
import fiftycent from "../assets/img/50%.svg";
import sixtycent from "../assets/img/60%.svg";
import sixtyfivecent from "../assets/img/65%.svg";
import seventy from "../assets/img/70%.svg";
import seventyfive from "../assets/img/75%.svg";
import eighty from "../assets/img/80%.svg";
import colorSharp from "../assets/img/color-sharp.png";
import { render } from "@testing-library/react";


export const Skills = () => {
    const responsive = {
        superLargeDesktop: {
          // the naming can be any, depends on you.
            breakpoint: { max: 4000, min: 3000 },
            items: 5
        },
        desktop: {
            breakpoint: { max: 3000, min: 1024 },
            items: 3
        },
        tablet: {
            breakpoint: { max: 1024, min: 464 },
            items: 2
        },
        mobile: {
            breakpoint: { max: 464, min: 0 },
            items: 1
        }
    };  

    let itemList = [];
    const map1 = new Map();

    map1.set('Java',eighty);
    map1.set('JavaScript',eighty);
    map1.set('MySql', meter1);
    map1.set('Angular', seventy);
    map1.set('React', sixtycent);
    map1.set('Css', meter1);
    map1.set('HTML5', meter1);
    map1.set('Scss', eighty);

    for (let [key, value] of map1) {
        itemList.push(
            'Hola'
        )
    }
    // let skills = ['Javaaa', 'JavaScript', 'Base de Datos','Angular', 'React', 'Css', 'Scss', 'HTML5'];
    // let img = [eighty, eighty, meter1, seventy, sixtycent, meter1, meter1, meter1]

    // let cont = 0

    // for (const i of skills) {

    //     for (const j of img) {
    //         itemList.push(
    //             <div className="item" key={cont}>
    //             <img src={meter1} alt="Image"/>
    //             <h5>{i}</h5>
    //         </div>
    //         )
    //     }
    // }


    // skills.forEach((x) => {
    //     cont ++;
    //     itemList.push(

    //     <div className="item" key={cont}>
    //         <img src={meter1} alt="Image"/>
    //         <h5>{x}</h5>
    //     </div>

    //     )
    // })

    return (
        <section className="skill" id="skills">
            <Container>
                <Row>
                    <Col className="col-12">
                        <div className="skill-bx wow zoomIn">
                            <h2>Skills</h2>
                            <p>Lorem Ipsum is simply dummy text of the printing and typesetting industry.
                                <br></br> Lorem Ipsum has been the industry's standard dummy text.
                            </p>
                            <Carousel responsive={responsive} infinite={true} className="skill-slider owl-carousel owl-theme">
                                {
                                    itemList
                                }
                                <div className="item">
                                    <img src={meter1} alt="Image"/>
                                    <h5>Java</h5>
                                </div>
                                <div className="item">
                                    <img src={meter1} alt="Image"/>
                                    <h5>JavaScript</h5>
                                </div>
                                <div className="item">
                                    <img src={meter1} alt="Image"/>
                                    <h5>Angular</h5>
                                </div>
                                <div className="item">
                                    <img src={meter1} alt="Image"/>
                                    <h5>React</h5>
                                </div>
                                <div className="item">
                                    <img src={meter1} alt="Image"/>
                                    <h5></h5>
                                </div>
                                <div className="item">
                                    <img src={meter1} alt="Image"/>
                                    <h5>Web Development</h5>
                                </div>
                                <div className="item">
                                    <img src={meter2} alt="Image"/>
                                    <h5>Brand Identify</h5>
                                </div>
                                <div className="item">
                                    <img src={meter3} alt="Image"/>
                                    <h5>Logo Desing</h5>
                                </div>
                                <div className="item">
                                    <img src={meter1} alt="Image"/>
                                    <h5>Web Development</h5>
                                </div>
                            </Carousel>
                        </div>
                    </Col>
                </Row>
            </Container>
            <img className="background-image-left" src={colorSharp} alt="Image"/>
        </section>
    )
}
